import React, { Component } from 'react';
import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import { Jumbotron, Button, ButtonToolbar } from 'reactstrap';
import btwist from './btwist.MOV';
import axios from 'axios';

class NameHeader extends React. Component {

  constructor(props) {
      super(props);
      this.state = {Name : "", Summary : ""};
    }
    render() {
      return (
        <div>
          <Jumbotron>
            <h1 className="display">Avery Wong</h1>
            <p className="lead">{"Hey guys this my personal website!"}</p>
            <hr className="my-2" />
            <p></p>
            <img width="400"  src={require('./profile.jpg')} />
            <p className="lead">
            </p>
          </Jumbotron>
        </div>
      );
    }

};

class ExperienceList extends Component {
  constructor(props) {
      super(props);
      this.state = {exp: []};
    }

  componentDidMount() {
   axios.get(`http://localhost:8080/GetUserExperienceData`)
     .then(res => {
       const expData = res.data;
       this.setState({ expData });
     })
 }

 render() {
   return (
     <ul>
     blank
       { this.state.exp.map(bullet=> <li>{bullet.String.Title}</li>)}
     </ul>
   )
}
}

class App extends Component {
  render() {
    return (
      <div className="App">
        <header className="App-header">
        <NameHeader />
        <ButtonToolbar>
          <Button size="large" variant="primary">Work Experience</Button>
          <Button size="large" variant="primary" href="#flip-video">Me Flipping</Button>
         </ButtonToolbar>
        <video width="1200"  id="flip-video" className='videoTag' autoPlay loop muted>
         <source src={btwist} type='video/mp4' />
       </video>
       <ExperienceList />
        </header>
      </div>
    );
  }
}



export default App;
